import React from "react";

const divStyle = {
  backgroundColor: "#4e74a6",
  padding: "50px",
  margin: "50px",
  marginTop: "0px"
};

class BillPage extends React.Component {
  render() {
    return (
      <div style={divStyle}>
        <h1 style={{ color: "#ffffff" }}>Placeholder [Bills]</h1>
      </div>
    );
  }
}

export default BillPage;
